using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class DeckSupportEFRTSingleInputModel : Notifier	{		public DeckSupportEFRTSingleInputModel()		{					Radius = "";			Qty = "";		}				private string _Radius;		public string Radius			{				get { return _Radius; }				set				{					_Radius = value;					OnPropertyChanged(nameof(Radius));				}			}				private string _Qty;		public string Qty			{				get { return _Qty; }				set				{					_Qty = value;					OnPropertyChanged(nameof(Qty));				}			}			}}